import React from 'react';
import Header from '../layout/Header';
import Footer from '../layout/Footer';

function Info(por) {
    return(
    <div className="main__cont">
        <div>WE PROVIDE</div>
        <div>VISUAL CODING</div>
        <div>SOLUTIONS</div>
        <div>FOR YOU WEBS</div>
    </div>
    );
}



function Main() {
    return (
      <div id="wrap">
        <Header/>
        <section id="mainCont">
           <Info/>
        </section>
        <Footer/>
      </div>
    );
  }

export default Main;
